Finally, for $j=3$ we have $$\begin{aligned}
\int_{{\mathbb{R}}}{\mathrm{e}}^{-u^*_{\tau}z\tau^{\alpha}}\left({\mathrm{e}}^{z\tau^{\alpha}}\wedge1\right){\mathrm{e}}^{{\mathtt{i}}u z}{\mathrm{d}}z
&=\int_{-\infty}^{0}{\mathrm{e}}^{-u^*_{\tau}z\tau^{\alpha}}{\mathrm{e}}^{z\tau^{\alpha}}{\mathrm{e}}^{{\mathtt{i}}u z}{\mathrm{d}}z
+\int_{0}^{\infty}{\mathrm{e}}^{-u^*_{\tau}z\tau^{\alpha}}{\mathrm{e}}^{{\mathtt{i}}u z}{\mathrm{d}}z \\
&=\left[\frac{{\mathrm{e}}^{z\left({\mathtt{i}}u-u^*_{\tau}\tau^{\alpha}+\tau^{\alpha}\right)}}
{\left({\mathtt{i}}u-u^*_{\tau}\tau^{\alpha}+\tau^{\alpha}\right)}\right]_{-\infty}^{0}
+\left[\frac{{\mathrm{e}}^{z\left({\mathtt{i}}u-u^*_{\tau}\tau^{\alpha}\right)}}
{\left({\mathtt{i}}u-u^*_{\tau}\tau^{\alpha}\right)}\right]_{0}^{\infty} 
=-C_{\tau,k,\alpha}(u),\end{aligned}$$ which is valid for $0<u^*_{\tau}(k)<1$.
